import React, {useState} from 'react';
import UserForm from './UserForm';
import CardMaker from './CardMaker';
import './App.css';

function App() {
  const [tea, setTeam] = useState()
  const [name, setName] = useState('')
  const [email, setEmail] = useState('')
  const [role, setRole] = useState('')

  return (
    <div>
      <h1>Team Builder</h1>
      <UserForm setName={setName} setEmail={setEmail} setRole={setRole}/>
      <CardMaker nmName={name} nmRole={role} nmEmail={email}/>
    </div>
  )
}


export default App;
